    - " Устанавливает семейство шрифта, которое будет использоваться для оформления
      текста содержимого. Список шрифтов может включать одно или несколько названий,
      разделенных запятой. Если в имени шрифта содержатся пробелы, например, Trebuchet
      MS, оно должно заключаться в одинарные или двойные кавычки.\n\nКогда браузер
      встречает первый шрифт в списке, он проверяет его наличие на компьютере пользователя.
      Если такого шрифта нет, берется следующее имя из списка и также анализируется
      на присутствие. Поэтому несколько шрифтов увеличивает вероятность, что хотя
      бы один из них будет обнаружен на клиентском компьютере. Заканчивают список
      обычно ключевым словом, которое описывает тип шрифта — serif, sans-serif, cursive,
      fantasy или monospace. Таким образом, последовательность шрифтов лучше начинать
      с экзотических типов и заканчивать обобщенным именем, которое задает вид начертания. "
